import React from "react";
import { Link } from "react-router-dom";
import Nav from "./Nav";
import movies from "../movies";
import Movie from "./Movie";

function Home() {
  return (
    <>
      <div className="moviesss-container">
        {movies.map((data) => (
          <Movie
            id={data.id}
            key={data.id}
            year={data.year}
            title={data.title}
            poster={data.poster}
            genre={data.genre}
          />
        ))}
      </div>
    </>
  );
}
export default Home;
